import React from 'react';
import HeaderWrapper from '../components/HeaderWrapper';

const styles = {
  profileImage: {
    transform: 'translateY(-70px)',
    border: '5px solid #fff',
    borderRadius: 45,
    marginLeft: 30
  },
  profileWrapper: {
    transform: 'translateY(-50px)',
    paddingLeft: 30,
    paddingRight: 30
  }
};

export default function Account() {
  return (
    <div>
      <HeaderWrapper>
        <h1 style={{ letterSpacing: 1.2 }}> 12 Jan 2020 </h1>
      </HeaderWrapper>
      <img style={styles.profileImage} src={require('../images/profile.jpg')} alt="profile" />
      <div style={styles.profileWrapper}>
        <h1 style={{ margin: 0 }}> Alec </h1>
        <h1 style={{ margin: 0 }}> Down</h1>
        <p> Profile </p>
      </div>
    </div>
  );
}
